import React from 'react';
import MyInput from "./UI/input/MyInput";

const PostFilter = ({name_filter, breed_filter, setFilter}) => {
    return (
        <div>
            <MyInput
                value={name_filter.query}
                onChange={e => setFilter({...name_filter, query: e.target.value})}
                placeholder="Search"
            />
            <MyInput
                value={breed_filter.query}
                onChange={e => setFilter({...breed_filter, query: e.target.value})}
                placeholder="Search"
            />
        </div>
    );
};

export default PostFilter;
